import { useState } from "react";

export const CreateFlight = () => {

    const {flight, setFlightID} = useState();

    const handleSubmit = (event) => {
        event.preventDefault(); // prevents page refresh on submit
    }
    return (
        <>
            <form>
                <div><label htmlFor="flight">Flight ID Number: </label>
                <input id="flight" placeholder="Please Enter Flight ID Number" value={flight._id} onChange={() => setFlightID}/></div><div>
                <label htmlFor="maxPass">Maximum Passenger Capacity: </label>
                <input id="maxPass" placeholder="Please Maximum Passenger Capacity" /></div><div>
                <label htmlFor="depCity">Departure City: </label>
                <input id="depCity" placeholder="Enter Departure City" /></div><div>
                <label htmlFor="depTime">Departure Time: </label>
                <input id="depTime" placeholder="Enter Departure Time" /></div><div>
                <label htmlFor="depDate">Departure Date: </label>
                <input id="depDate" placeholder="Enter Departure Date" /></div><div>
                <label htmlFor="arrCity">Arrival City: </label>
                <input id="arrCity" placeholder="Enter Arrival City" /></div><div>
                <label htmlFor="arrTime">Arrival Time: </label>
                <input id="arrTime" placeholder="Enter Arrival Time" /></div><div>
                <label htmlFor="arrDate">Arrival Date: </label>
                <input id="arrDate" placeholder="Enter Arrival Date" /></div><div>
                <button onClick={handleSubmit}>setFlightID: </button></div>
            </form>
        
        </>

    );
}
